webpackJsonp([0x368e32a99f744c00],{"./node_modules/json-loader/index.js!./.cache/json/html-elements-button-tag.json":function(t,n){t.exports={data:{markdownRemark:{html:'<h2>Button Tag</h2>\n<p>A <code>&#x3C;button></code> tag specifies a clickable button on the HTML document.\nBetween the <code>&#x3C;button></code> tags, you can put content, like text or images. This is different from the button created using <code>&#x3C;input></code> tag, which only takes text as content.</p>\n<p><strong>Syntax:</strong></p>\n<p><code>&#x3C;button type="submit">Click Here!&#x3C;/button></code></p>\n<p><strong>Atributes:</strong></p>\n<p>Following are the associated attribute supported by HTML 4:</p>\n<table>\n<thead>\n<tr>\n<th><strong>Attributes</strong></th>\n<th><strong>Value</strong></th>\n<th><strong>What it does</strong></th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>disabled</td>\n<td>disabled</td>\n<td>Disables the button</td>\n</tr>\n<tr>\n<td>name</td>\n<td>name</td>\n<td>Specifies a name for the button. The name is for referencing the button in HTML form, JS, etc.</td>\n</tr>\n<tr>\n<td>type</td>\n<td>button or reset or submit</td>\n<td>Sets the type of the button. A button with \n<code>button</code>\n type is a simple clickable button, with \n<code>submit</code>\n type it submits form-data, and with \n<code>reset</code>\n type it resets form-data.</td>\n</tr>\n<tr>\n<td>value</td>\n<td>text</td>\n<td>Sets an initial value for the button. This value is sent along with the form-data.</td>\n</tr>\n</tbody>\n</table>\n<p>HTML 5 supports the following extra attributes:</p>\n<table>\n<thead>\n<tr>\n<th><strong>Attributes</strong></th>\n<th><strong>Value</strong></th>\n<th><strong>What it does</strong></th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>autofocus</td>\n<td>autofocus</td>\n<td>Should the button automatically get focus when the page loads. For example, see Google. As the page gets loaded completely, the text-box get focus automatically.</td>\n</tr>\n<tr>\n<td>form</td>\n<td>form_id</td>\n<td>Specifies one or more forms the button belongs to.</td>\n</tr>\n<tr>\n<td>formaction</td>\n<td>URL</td>\n<td>Specifies where to send the form-data once the \n<code>submit</code>\n type button is pressed.</td>\n</tr>\n<tr>\n<td>formmethod</td>\n<td>get or post</td>\n<td>Specifies how to send the form-data. Only for \n<code>submit</code>\n type button.</td>\n</tr>\n<tr>\n<td>formtarget</td>\n<td><code>_blank</code>\n or \n<code>_self</code>\n or \n<code>_parent</code>\n or \n<code>_top</code>\n or framename</td>\n<td>Specifies the location where the result is to be displayed after submitting form-data.</td>\n</tr>\n</tbody>\n</table>\n<p><strong>Example:</strong></p>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>html</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>head</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>title</span><span class="token punctuation">></span></span>Button Tag example<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>title</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>head</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>body</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>form</span><span class="token punctuation">></span></span>\n      First name:<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>br</span><span class="token punctuation">></span></span>\n      <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>input</span> <span class="token attr-name">type</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>text<span class="token punctuation">"</span></span> <span class="token attr-name">name</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>firstname<span class="token punctuation">"</span></span> <span class="token attr-name">value</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>Free<span class="token punctuation">"</span></span><span class="token punctuation">></span></span>\n      <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>br</span><span class="token punctuation">></span></span>\n      Last name:<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>br</span><span class="token punctuation">></span></span>\n      <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>input</span> <span class="token attr-name">type</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>text<span class="token punctuation">"</span></span> <span class="token attr-name">name</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>lastname<span class="token punctuation">"</span></span> <span class="token attr-name">value</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>CodeCamp<span class="token punctuation">"</span></span><span class="token punctuation">></span></span>\n      <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>br</span><span class="token punctuation">></span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>br</span><span class="token punctuation">></span></span>\n      <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>input</span> <span class="token attr-name">type</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>submit<span class="token punctuation">"</span></span> <span class="token attr-name">value</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>Submit<span class="token punctuation">"</span></span> <span class="token attr-name">formtarget</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>_self<span class="token punctuation">"</span></span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>form</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>body</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>html</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n<p>All major browsers support the <code>&#x3C;button></code> tag. <code>&#x3C;button></code> tag also supports event attributes in HTML.\n<strong>Note:</strong> Different browsers may send different values if you use <code>&#x3C;button></code> element. It is advised to either specify the button value or use the <code>&#x3C;input></code> tag to create button in an HTML form.</p>\n<p><strong>Other resources:</strong></p>\n<ul>\n<li>Other attributes:</li>\n</ul>\n<table>\n<thead>\n<tr>\n<th><strong>Attributes</strong></th>\n<th><strong>Link</strong></th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>formenctype</td>\n<td><a href="https://www.w3schools.com/TAgs/att_button_formenctype.asp">https://www.w3schools.com/TAgs/att<em>button</em>formenctype.asp</a></td>\n</tr>\n<tr>\n<td>formnovalidate</td>\n<td><a href="https://www.w3schools.com/TAgs/att_button_formnovalidate.asp">https://www.w3schools.com/TAgs/att<em>button</em>formnovalidate.asp</a></td>\n</tr>\n</tbody>\n</table>\n<ul>\n<li><code>&#x3C;input></code> tag: <a href="https://www.w3schools.com/TAgs/tag_input.asp">https://www.w3schools.com/TAgs/tag_input.asp</a></li>\n<li>Event Attributes: <a href="https://www.w3schools.com/TAgs/ref_eventattributes.asp">https://www.w3schools.com/TAgs/ref_eventattributes.asp</a></li>\n<li><code>formtarget</code> attribute values: <a href="https://www.w3schools.com/TAgs/att_button_formtarget.asp">https://www.w3schools.com/TAgs/att<em>button</em>formtarget.asp</a></li>\n<li>HTML Form: </li>\n</ul>',fields:{slug:"/html/elements/button-tag/"},frontmatter:{title:"Button Tag"}}},pathContext:{slug:"/html/elements/button-tag/"}}}});
